import React from 'react';
import ReactDOM from 'react-dom';

let mainBoxStyle = {
  width:"700px",
  height:"100px",
  border: "1px solid grey",
  backgroundColor:"white"

}
let blackBoxStyle = {
  width:"200px",
  height:"70px",
  backgroundColor: "black",
  fontSize: "30px",
  textAlign: "center",
  color: "yellow",
  padding: "100px",
  float: "left"
}
/*Red box style*/
let redBoxStyle = {
  width:"200px",
  height:"70px",
  backgroundColor: "red",
  fontSize: "30px",
  textAlign: "center",
  color: "blue",
  padding: "100px",
  float: "left"
}
/*Green Box style*/
let greenBoxStyle = {
  width:"200px",
  height:"70px",
  backgroundColor: "green",
  fontSize: "30px",
  textAlign: "center",
  color: "white",
  padding: "100px",
  float: "left"
}


let BlackBox = () => <div style = {blackBoxStyle}> Yellow In Black </div>;
let RedBox = () => <div style = {redBoxStyle}> Blue In Red </div>;
let GreenBox = () => <div style = {greenBoxStyle}> White In Green </div>;
let App = () => (
                <div style={mainBoxStyle}>
                  <BlackBox/>
                  <RedBox/>
                  <GreenBox/>
                </div>
              );


ReactDOM.render(
  <App/>,
  document.getElementById('root')

);
